import React from "react";
import "./App.css";
import * as ReactBootStrap from "react-bootstrap";

function App() {
  return (
    <ReactBootStrap.Navbar bg="light" expand="lg">
      <Navbar.Brand href="#home">SUSPECT DETECTION SYSTEM</Navbar.Brand>
      <Navbar.Toggle aria-controls="basic-navbar-nav" />
      <Navbar.Collapse id="basic-navbar-nav">
        <Nav className="mr-auto">
          <Nav.Link href="LOGIN LINK HERE">Login</Nav.Link>
          <Nav.Link href="SIGNUP LINK HERE">Sign Up!</Nav.Link>
          <Nav.Link href="CONTACT US LINK HERE">Contact Us</Nav.Link>
        </Nav>
      </Navbar.Collapse>
    </ReactBootStrap.Navbar>
  );
}

export default App;
